INSERT INTO `site_config` (`id_site_config`, `site_name`, `site_description`, `site_admin_username`, `site_admin_password`, `contact_detail`, `facebook`, `twitter`, `googleplus`, `flickr`, `sharethis`, `admin_text`, `box_one`, `box_two`, `box_three`) VALUES
(1, '', '<p>Your business needs a great website.</p>\r\n\r\n<p>We simplified every aspect of building a beautiful branded website&mdash;so you can share your work easily and get back to making what you love.</p>\r\n\r\n<p>&nbsp;</p>\r\n', '', '', '', '', '', '', '', '', '<p style="text-align:justify">Creating your website should be fun. Our website builder enables everyone to set up a personal website in just a few clicks with stunning results. Don&rsquo;t waste your time on expensive programmers or complicated interfaces. Be in CONTROL!</p>\n', '<h2>Create your website</h2>\r\n\r\n<p>Go live with a simple click. No coding.</p>\r\n\r\n<p>Create a mobile and dynamic website for free in less than one minute.</p>\r\n\r\n<p>Simply Sign Up for Free and VOILA! Your website is online and running.</p>\r\n\r\n<p>Creating your website should be fun. Our website builder enables everyone to set up a personal website in just a few clicks with stunning results. Don&rsquo;t waste your time on expensive programmers or complicated interfaces. Be in control.</p>\r\n', '<h2>What do you get?</h2>\r\n\r\n<p>Your website will be backed up with a CMS (Content Management System).</p>\r\n\r\n<p>Add unlimited amount of pages, images and information to your website anytime you want.</p>\r\n\r\n<p><a href="http://localhost/webagency/about-us" style="color: rgb(0, 120, 207); cursor: pointer; text-decoration: none; transition: color 0.2s ease; -webkit-transition: color 0.2s ease;">&nbsp;Click here</a>&nbsp;to see examples of how your website might look like</p>\r\n', '<h2>Features</h2>\r\n\r\n<p>Information pages - Unlimited amount of pages backed by a rich text content editor.</p>\r\n\r\n<p>Product Catalogue - Unlimited amount of product categories and product.</p>\r\n\r\n<p>Photos Gallery - Unlimited amount of albums and photos.</p>\r\n\r\n<p>A Google map pointing exactly where your business is located.</p>\r\n\r\n<p>Contact form - Potential clients can contact you.</p>\r\n\r\n<p>Link back to all your Social Media Profiles. facebook, twitter, google +</p>\r\n');
